import { useEffect } from "react"
import projectData from "../util/projectData"
import ProjectItem from "./ProjectItem"

const Projects = () => {

const data = projectData.map((data, index) => {
  return (
    <ProjectItem index={index} title={data.title} description={data.description} github={data.links.github} website={data.links.website} date={data.date} />
  )
})

  return (
    <div class="row row-cols-1 row-cols-md-3 g-4 my-5 text-center">
      {data}
    </div>
  )
}

export default Projects
